message:
'Analema' 8️⃣

Em astronomia, um analema; do grego antigo 'ἀνάλημμα' é um diagrama que mostra a posição do 🌞 Sol no céu vista de um local fixo na 🌎 Terra no mesmo tempo 💫 solar médio, pois essa posição varia ao longo de um ano. O diagrama será semelhante ao número 8️⃣ oito.

@VoicesofRevelation 🕊
